script: |
  super -f text -I q6311.spq | sort > q6311.out

inputs:
  - name: q6311.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT ( col0 + - + 92 BETWEEN + + col2 * + col2 + - - 25 - 81 + - - 75 + + - 92 + + col0 / - - col0 * 98 * + col2 AND NULL );
  - name: tab1

outputs:
  - name: q6311.out
    data: |
      51	14	96
      85	5	59
      91	47	68
